// TopNavBar.js
import React from 'react';
import { Link } from 'react-router-dom';

const styles = {
  topNavBar: {
    backgroundColor: '#003366', // Dark blue background
    color: 'white',
    padding: '10px 20px',
    display: 'flex',
    justifyContent: 'space-between', // Space out the elements
    alignItems: 'center',
    fontSize: '14px', // Smaller font
  },
  topNavItem: {
    display: 'flex',
    alignItems: 'center',
  },
  phoneButton: {
    marginLeft: '10px',
    padding: '5px 10px',
    backgroundColor: '#ffffff',
    color: '#003366',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
  },
  scheduleButton: {
    backgroundColor: '#add8e6', // Light blue
    color: '#003366',
    border: 'none',
    padding: '10px 20px',
    borderRadius: '5px',
    cursor: 'pointer',
  },
};

function TopNavBar() {
  return (
    <div style={styles.topNavBar}>
      {/* Contact Support Section */}
      <div style={styles.topNavItem}>
        <span>Contact Support: 000-000-0000</span>
        <a href="tel:0000000000" style={styles.phoneButton}>Call</a>
      </div>

      {/* IT Support Section */}
      <div style={styles.topNavItem}>
        <span>IT Support: 000-000-000</span>
        <a href="tel:000000000" style={styles.phoneButton}>Call</a>
      </div>

      {/* Schedule Consultation Button */}
      <div>
        <Link to="/consultation" style={styles.scheduleButton}>Schedule Consultation</Link>
      </div>
    </div>
  );
}

export default TopNavBar;
